let btn=document.querySelector("button"),output=document.querySelector("#output");function getRandomNumber(e,r){r=r-e+1,r=Math.random()*r;return Math.floor(r)+e}function createArrayOfNumbers(r,t){let a=[];for(let e=r;e<=t;e++)a.push(e);return a}let generatedNumbersArray=[];function createArrayOfRandomNumbersMega(){let r=createArrayOfNumbers(1,60);for(let e=1;e<=6;e++){var t=getRandomNumber(0,r.length-1),a=r[t];r.splice(t,1),generatedNumbersArray.push(a),output.innerText=JSON.stringify(generatedNumbersArray)}return generatedNumbersArray}function createArrayOfRandomNumbersEasy(){let r=createArrayOfNumbers(1,25);for(let e=1;e<=15;e++){var t=getRandomNumber(0,r.length-1),a=r[t];r.splice(t,1),generatedNumbersArray.push(a),output.innerText=JSON.stringify(generatedNumbersArray)}return generatedNumbersArray}btn.addEventListener("click",()=>{createArrayOfRandomNumbersEasy(),generatedNumbersArray=[]});